INSERT INTO `product_description` VALUES (5,5,'','English'),(6,5,'Оригінальний дерев’яний постер прикрасить інтер’єр Вашої кімнати чи кухні, офісу, бару  або кав’ярні. Стильний дерев’яний «плакат» із зображенням будь-якої направленості стане чудовим подарунком для знайомих і близьких. Ручна робота і тепло дерев’яної фактури спонукають не раз потримати постер в руках. А висока якість виготовлення в техніці вживлення, що віддалено нагадує дитяче захоплення – перевідні картинки, та виконана вручну затертість надають особливий шарм і унікальність кожному постеру. Фактуру затертості неможливо відтворити двічі: навіть постери з однаковим зображенням будуть відрізнятися один від одного. Тому готовий виріб може дещо різнитися з виробом на фото.','Ukraine'),(7,5,'Оригинальный деревянный постер украсит интерьер Вашей комнаты или кухни, офиса, бара или кофейни. Стильный деревянный «плакат» с изображением любой направленности станет отличным подарком для знакомых и близких. Ручная работа и тепло деревянной фактуры вызывают желание не раз подержать постер в руках. А высокое качество изготовления в технике вживления, отдаленно напоминающей детскую увлеченность – переводные картинки, и выполненная вручную затертость придают особый шарм и уникальность каждому постеру.  Фактуру потертости невозможно воспроизвести дважды: даже постеры с одинаковым изображением будут отличаться друг от друга. Поэтому готовое изделие может несколько разниться с изделием на фото.','Russian'),(8,6,'','English'),(9,6,'Оригінальний дерев’яний постер прикрасить інтер’єр Вашої кімнати чи кухні, офісу, бару  або кав’ярні. Стильний дерев’яний «плакат» із зображенням будь-якої направленості стане чудовим подарунком для знайомих і близьких. Ручна робота і тепло дерев’яної фактури спонукають не раз потримати постер в руках. А висока якість виготовлення в техніці вживлення, що віддалено нагадує дитяче захоплення – перевідні картинки, та виконана вручну затертість надають особливий шарм і унікальність кожному постеру. Фактуру затертості неможливо відтворити двічі: навіть постери з однаковим зображенням будуть відрізнятися один від одного. Тому готовий виріб може дещо різнитися з виробом на фото.','Ukraine'),(10,6,'Оригинальный деревянный постер украсит интерьер Вашей комнаты или кухни, офиса, бара или кофейни. Стильный деревянный «плакат» с изображением любой направленности станет отличным подарком для знакомых и близких. Ручная работа и тепло деревянной фактуры вызывают желание не раз подержать постер в руках. А высокое качество изготовления в технике вживления, отдаленно напоминающей детскую увлеченность – переводные картинки, и выполненная вручную затертость придают особый шарм и уникальность каждому постеру.  Фактуру потертости невозможно воспроизвести дважды: даже постеры с одинаковым изображением будут отличаться друг от друга. Поэтому готовое изделие может несколько разниться с изделием на фото.','Russian'),(11,7,'Оригинальный деревянный постер украсит интерьер Вашей комнаты или кухни, офиса, бара или кофейни. Стильный деревянный «плакат» с изображением любой направленности станет отличным подарком для знакомых и близких. Ручная работа и тепло деревянной фактуры вызывают желание не раз подержать постер в руках. А высокое качество изготовления в технике вживления, отдаленно напоминающей детскую увлеченность – переводные картинки, и выполненная вручную затертость придают особый шарм и уникальность каждому постеру.  Фактуру потертости невозможно воспроизвести дважды: даже постеры с одинаковым изображением будут отличаться друг от друга. Поэтому готовое изделие может несколько разниться с изделием на фото.','Russian'),(12,7,'Оригінальний дерев’яний постер прикрасить інтер’єр Вашої кімнати чи кухні, офісу, бару  або кав’ярні. Стильний дерев’яний «плакат» із зображенням будь-якої направленості стане чудовим подарунком для знайомих і близьких. Ручна робота і тепло дерев’яної фактури спонукають не раз потримати постер в руках. А висока якість виготовлення в техніці вживлення, 