','Ukraine'),(999,336,'','English'),(1000,336,'Оригинальный деревянный постер украсит интерьер Вашей комнаты или кухни, офиса, бара или кофейни. Стильный деревянный «плакат» с изображением любой направленности станет отличным подарком для знакомых и близких. Ручная работа и тепло деревянной фактуры вызывают желание не раз подержать постер в руках. А высокое качество изготовления в технике вживления, отдаленно напоминающей детскую увлеченность – переводные картинки, и выполненная вручную затертость придают особый шарм и уникальность каждому постеру.  Фактуру потертости невозможно воспроизвести дважды: даже постеры с одинаковым изображением будут отличаться друг от друга. Поэтому готовое изделие может несколько разниться с изделием на фото.','Russian'),(1001,337,'Оригинальный деревянный постер украсит интерьер Вашей комнаты или кухни, офиса, бара или кофейни. Стильный деревянный «плакат» с изображением любой направленности станет отличным подарком для знакомых и близких. Ручная работа и тепло деревянной фактуры вызывают желание не раз подержать постер в руках. А высокое качество изготовления в технике вживления, отдаленно напоминающей детскую увлеченность – переводные картинки, и выполненная вручную затертость придают особый шарм и уникальность каждому постеру.  Фактуру потертости невозможно воспроизвести дважды: даже постеры с одинаковым изображением будут отличаться друг от друга. Поэтому готовое изделие может несколько разниться с изделием на фото.','Russian'),(1002,337,'Оригінальний дерев’яний постер прикрасить інтер’єр Вашої кімнати чи кухні, офісу, бару або кав’ярні. Стильний дерев’яний «плакат» із зображенням будь-якої направленості стане чудовим подарунком для знайомих і близьких. Ручна робота і тепло дерев’яної фактури спонукають не раз потримати постер в руках. А висока якість виготовлення в техніці вживлення, що віддалено нагадує дитяче захоплення – перевідні картинки, та виконана вручну затертість надають особливий шарм і унікальність кожному постеру. Факт